import React from "react";
import "./Thanks.css";
import axios from "axios";
import PinknavRight from "../../Components/Pinknav/pinknav-right";



function ThanksPage() {

    async function fetchCompliment() {
        try {
            const result = await axios.get('https://complimentr.com/api');
            return result.data.compliment;

        } catch (e) {
            console.error(e);
        }
    }

     const compliment = fetchCompliment()

    return (
        <>
            <header>
                <PinknavRight

                    title='Thanks User'
                />

            </header>

            <main className="inner-container-left">
                <h2>
                   Thanks voor het invullen van de bestellijst!
                    {compliment}
                </h2>

            </main>
        </>

    )
}


export default ThanksPage
